  useEffect(() => {
    fetch("https://api.openweathermap.org/data/2.5/weather?id=524901&appid=0ae00247922956c17d86ed4e22c8879b")
      .then((response) => response.json())
      .then((info) => setData(info.name))
  }, [])


  console.log(data);

  return (
    <div>App</div>
  )
}

